const Header = ({title}) => {
  return (
    <header className = 'header' >
      <h1 >{title}</h1>
      <button>Add</button>
    </header>
  )
}

Header.defaultProps = {

    title: 'Task Traker'
}

Header.propTypes = {

    title: PropTypes.string
}
export default Header
